import React from "react";



const Forecast = ({weather}) => {
    if (weather) {
    return (
        <div>
            <div class="container">
                <div class="row">
                    {weather[0].split("T")[1]}: {weather[1]} F
                </div>
            </div>
        </div>
    );
    } else {
        return;
    }
}

export default Forecast;
